  content: "Hey searchone \U0001F44B, \n\n Your model repository seems to contain\
    \ logic to load a feature extractor that is deprecated, which you should notice\
    \ by seeing the warning: \n\n ```\ntransformers/models/clip/feature_extraction_clip.py:28:\
    \ FutureWarning: The class CLIPFeatureExtractor is deprecated and will be removed\
    \ in version 5 of Transformers. Please use CLIPImageProcessor instead. warnings.warn(\n\
    ``` \n\n when running `pipe = DiffusionPipeline.from_pretrained(searchone/search1nedev-dreambooth-sd15)`.This\
    \ PR makes sure that the warning does not show anymore by replacing `CLIPFeatureExtractor`\
    \ with `CLIPImageProcessor`. This will certainly not change or break your checkpoint,\
    \ but onlymake sure that everything is up to date. \n\n Best, the \U0001F9E8 Diffusers\
